import React from "react";
import './NavBar.css';
import Nav from 'react-bootstrap/Nav';
import PersonIcon from '@mui/icons-material/Person';
import WorkIcon from '@mui/icons-material/Work';
import ContactPageIcon from '@mui/icons-material/ContactPage';
import HomeIcon from '@mui/icons-material/Home';

function NavBar() {
  return (
    <Nav variant="pills" defaultActiveKey="/" class="nav_bar" >
      <Nav.Item className="item">
        <Nav.Link className = "link" href="/">
          <HomeIcon/>
          <span style="--g:1">Home</span>
        </Nav.Link>
      </Nav.Item>

      <Nav.Item className="item">
        <Nav.Link className = "link" href="/about">
          <PersonIcon/>
          <span style="--g:1">About Me</span>
        </Nav.Link>
      </Nav.Item>

      <Nav.Item className="item">
        <Nav.Link className = "link" href="/experience">
          <WorkIcon/>
          <span style="--g:1">Experience</span>
        </Nav.Link>
      </Nav.Item>

      <Nav.Item className="item">
        <Nav.Link className = "link" href="/contact">
          <ContactPageIcon/>  
          <span style="--g:1">Let's Connect!</span>
        </Nav.Link>
      </Nav.Item>
    </Nav>

  );
}

export default NavBar;
